import './App.css';
import BottomNav from './components/BottomNav';
import Hero from './components/Hero';
import Navbar from './components/Navbar';

const App = () => {
	return (
		<div className="App">
			<Navbar />
			<Hero />
			<BottomNav className="lg:hidden"/>
		</div>
	);
}

export default App;
